      top: -25vh;
      left: 20vw;

      g,
      polygon {
        fill: rgba(0, 0, 0, 0.1);
      }
    }

    .bg svg {
      position: absolute;
      bottom: 0;
      left: 25%;
      z-index: 0;

      g,
      polygon,
      path,
      rect,
      circle {
        fill-opacity: 0.9;
        stroke: 1px;
      }
    }

