      }

      &:hover {
        @extend .z-depth-2;
      }
    }

    .card .card-content .card-title {
      font-size: 0.87rem;
      font-weight: 300;
      line-height: 38px;
      margin-bottom: 0;
    }

    .card .card-content a,
    .card .card-reveal a {
      @include sans-serif;

      color: color('grey', 'darken-4') !important;
      text-transform: uppercase;
    }

    .card .study-name a,
    .card .card-reveal a {
      font-weight: 500;
      letter-spacing: 0.1ch;
      font-size: 1rem;
    }

    .card .card-content .btn-floating {
      i {
        position: relative;
        top: 2px;
      }

      height: 38px;
      width: 38px;
    }

    .card .card-reveal .card-title {
      @include sans-serif;

      text-transform: uppercase;
      font-weight: 500;
      letter-spacing: 0.2ch;
      color: color('grey', 'darken-5');
    }

    .card .card-reveal p {
      font-family: 'Simplon Mono', monospace;
      font-size: 0.85rem;
    }

    .card .card-reveal .tech {
      color: color('purple', 'darken-2');
    }
  }

  #sectionOne {
    z-index: 2;

    .container {
      margin-bottom: 10vh;
    }

    h2 {
      @extend %h1;

      @media #{$medium-and-down} {
        font-size: 1.5rem;
      }
    }

    .btn {
      @include pulse(4s, infinite);
    }
  }
}

